import React from 'react'
import {Card} from 'react-bootstrap'


export default function  Incio({data}){
  return (
              <div>
                    <br></br>

                    <div>
                    <h1>API START WARS</h1>  
                    </div>

              <h5 className="card-title">Personajes</h5>
              <p  className="card-text" >Lista de Personajes</p>


               {data.map((personaje,i)=>{
                  return(
                          <div>     

                        <div className="card-columns"  key={i}> 

                                <Card style={{ width: '18rem' }}>
                                <Card.Img variant="top" src="holder.js/100px180" />
                                <Card.Body>
                                  <Card.Title>{personaje.name}</Card.Title>
                                  <Card.Text> Altura: {personaje.height}</Card.Text>  
                                  <Card.Text>{personaje.mass}</Card.Text>  
                                </Card.Body>
                              </Card>

                        </div>



                      </div>

                  )
               })} 

              </div>

              )




}
